import React,{useState} from 'react';


const Api = async () => {

  const [data,setData] = useState([]);

  const petition = await fetch(`http://127.0.0.1:8000/api/countries/list`);
  const countries = await petition.json();
  setData(countries);
  return data; 
}

export default Api;
